To make a button, you can use HTML and CSS. Here is a simple example:

HTML:
```html
<button class="my-button">Click Me</button>
```

CSS:
```css
.my-button {
  background-color: #4CAF50; /* Green */
  border: none;
  color: white;
  padding: 15px 32px;
  text-align: center;
  text-decoration: none;
  display: inline-block;
  font-size: 16px;
  margin: 4px 2px;
  cursor: pointer;
}
```

You can customize the button further by changing the background color, text color, padding, font size, border, etc. to fit your design preferences.
